import React from 'react'
import { Row, Col } from 'react-bootstrap'

export const HomePage = () => {
    return (
        <Row style={{ height: '100%' }}>
            <Col style={ styles.col } className='d-flex justify-content-center'>1 of 3</Col>
            <Col className='d-flex justify-content-center'>2 of 3</Col>
            <Col className='d-flex justify-content-center'>3 of 3</Col>
        </Row>
    )
}







styles = {
    col: {
        backgroundColor: 'red',
        borderRadious: '1rem'
    }
}
